mapper.select:
select 

from store_warehouse_in
where CARD_NO = #{cardNo,jdbcType=VARCHAR}
  and RECEIPT_NO = #{receiptNo,jdbcType=CHAR}
  and COMPANY_ID = #{companyId,jdbcType=BIGINT}

mapper.delete:
delete from store_warehouse_in
where CARD_NO = #{cardNo,jdbcType=VARCHAR}
  and RECEIPT_NO = #{receiptNo,jdbcType=CHAR}
  and COMPANY_ID = #{companyId,jdbcType=BIGINT}

mapper.update:
update store_warehouse_in
set WAREHOUSE_OUT_NO = #{warehouseOutNo,jdbcType=CHAR},
  STORE_FROM = #{storeFrom,jdbcType=BIGINT},
  STORE_TO = #{storeTo,jdbcType=BIGINT},
  CREATE_TIME = #{createTime,jdbcType=TIMESTAMP},
  CREATE_ID = #{createId,jdbcType=BIGINT},
  UPDATE_TIME = #{updateTime,jdbcType=TIMESTAMP},
  UPDATE_ID = #{updateId,jdbcType=BIGINT},
  IS_DELETED = #{isDeleted,jdbcType=INTEGER}
where CARD_NO = #{cardNo,jdbcType=VARCHAR}
  and RECEIPT_NO = #{receiptNo,jdbcType=CHAR}
  and COMPANY_ID = #{companyId,jdbcType=BIGINT}

